// wszystkie event listenery
const guzik_rzeki = document.querySelector("#guzik-rzeki");
guzik_rzeki.addEventListener("click", pokaz_rzeki);

const guzik_wojewodztwa = document.querySelector("#guzik-wojewodztwa");
guzik_wojewodztwa.addEventListener("click", pokaz_wojewodztwa);

const obrazek = document.querySelector("#obrazek");
obrazek.addEventListener("click", e => postaw_czerwona_pinezke(e));

const zatwierdz = document.querySelector("#guzik-zatwierdz");
zatwierdz.addEventListener("click", reset);

const pinezka = document.querySelector("#pinezka");
const pinezka2 = document.querySelector("#pinezka2");

const miejsce_na_pkt = document.querySelector("#wynik");

//zmienne, które muszą być globalne, nwm czy to najlepszy sposób na to
var rzeki = false;
var wojewodztwa = false;

var x_geo = 0;
var y_geo = 0;
var wynik = 0;
var dlug_geo = 0;
var szer_geo = 0;
var dystans = 0;
var punkty = 0;

function pokaz_rzeki(){
	rzeki = true;
	
	if(rzeki && wojewodztwa){
		obrazek.src = "wojewodztwa_i_rzeki.svg";
	}else{
		obrazek.src = "rzeki_bez_wojewodztw.svg";
	}
	
	guzik_rzeki.classList.remove("aktywny");
	guzik_rzeki.classList.add("nieaktywny");
	
	punkty -= 2;

	miejsce_na_pkt.innerText = punkty;
	
}

// zarówno powyżej jak i poniżej: zmienna kontrolna na true, podmiana tła, zmiana klasy guzika i liczby punktów

function pokaz_wojewodztwa(){
	wojewodztwa = true;
	
	if(wojewodztwa && rzeki){
		obrazek.src = "wojewodztwa_i_rzeki.svg";
	}else{
		obrazek.src = "wojewodztwa_bez_rzek.svg";
	}
	
	guzik_wojewodztwa.classList.remove("aktywny");
	guzik_wojewodztwa.classList.add("nieaktywny");
	
	punkty -= 2;
	
	miejsce_na_pkt.innerText = punkty;
}


function postaw_czerwona_pinezke(event){
	
		// biorę odległości od krawędzi, póki co w pikselach, przydadzą się później
		var rect = event.target.getBoundingClientRect();
		x_geo = Math.ceil(event.clientX - rect.left);
		y_geo = Math.ceil(event.clientY - rect.top);
		
		// miejsce kliknięcia
		var x_pin = event.clientX;
		var y_pin = event.clientY;
		
		// pozycja pinezki obstawienia w zależności od miejsca kliknięcia
		pinezka.style.top = (y_pin - (pinezka.height) + "px");
		pinezka.style.left = (x_pin - (pinezka.width/2) + "px");
	
}


function postaw_niebieska_pinezke(){
	
	//wzięcie danych
	x_geo = miasto.longitude;
	y_geo = miasto.latitude;
	
	// zamiana współrzędnych geograficznych na współrzędne na obrazku
	x_pin = ((x_geo-13.8)*obrazek.width)/10.7;
	y_pin = ((y_geo-48.7)*obrazek.height)/6.5;
	
	// pozycja pinezki faktycznej lokalizacji w zależności od miejsca kliknięcia
	pinezka2.style.top = obrazek.getBoundingClientRect().top - pinezka2.height + obrazek.height - y_pin + "px";
	pinezka2.style.left = obrazek.getBoundingClientRect().left - (pinezka2.width/2) + x_pin + "px";
}


// poniższa funkcja jest wzięta z internetu, w sobie tylko znany sposób liczy odległość po kuli ziemskiej
function distance(lat1, lon1, lat2, lon2) {
  const r = 6371; // km
  const p = Math.PI / 180;

  const a = 0.5 - Math.cos((lat2 - lat1) * p) / 2
                + Math.cos(lat1 * p) * Math.cos(lat2 * p) *
                  (1 - Math.cos((lon2 - lon1) * p)) / 2;

  return 2 * r * Math.asin(Math.sqrt(a));
}


function reset(){
	
	// zamiana współrzędnych, 13.8 i 48.7 to współrzędne geograficzne krawędzi mapy, 10.7 i 6.5 to rozmiar pokazanej części mapy w stopniach
	dlug_geo = 13.8 + (x_geo/obrazek.width*10.7);
	szer_geo = 48.7 + ((obrazek.width-y_geo)/obrazek.height*6.5);
	
	// dystans funkcją ze stack overflow
	dystans = distance(szer_geo, dlug_geo, miasto.latitude, miasto.longitude);
	
	// pinezka prawdziwej lokalizacji
	postaw_niebieska_pinezke();
	
	// switch(true) jest dziwnym, ale działającym sposobem na porównywanie zmiennych w switchu
	switch(true){
		case (dystans < 31):
			punkty += 10;
			break;
		
		case (dystans < 71):
			punkty += 8;
			break;
		
		case (dystans < 121):
			punkty += 5;
			break;
		
		case (dystans < 201):
			punkty += 2;
			break;
		
		case (dystans > 200):
			punkty += 0;
			break;
	}
	
	miejsce_na_pkt.innerText = punkty;
	
	// losowe miasto
	miasto = miasta[(Math.floor(Math.random() * miasta.length))];
	
	// wstawienie nowego miasta i odległości
	document.querySelector("#cel").innerText = miasto.name;
	document.querySelector("#odleglosc").innerText = parseInt(dystans);
	
	// mapa na pustą
	obrazek.src = "pusta.svg";
	
	// reset guzików
	guzik_wojewodztwa.classList.remove("nieaktywny");
	guzik_wojewodztwa.classList.add("aktywny");
	guzik_rzeki.classList.remove("nieaktywny");
	guzik_rzeki.classList.add("aktywny");
	
	// reset zmiennych od podpowiedzi
	rzeki = false;
	wojewodztwa = false;
}

// poza funkcją, po prostu wstawka miasta przy 1-szym odpaleniu gry
var miasto = miasta[(Math.floor(Math.random() * miasta.length))];
document.querySelector("#cel").innerText = miasto.name;

// środkowanie pinezek, czerwonej i niebieskiej
pinezka.style.top = obrazek.getBoundingClientRect().top - pinezka.height + (obrazek.height/2) + "px";
pinezka.style.left = obrazek.getBoundingClientRect().left - (pinezka.width/2) + (obrazek.width/2) + "px";

pinezka2.style.top = obrazek.getBoundingClientRect().top - pinezka2.height + (obrazek.height/2) + "px";
pinezka2.style.left = obrazek.getBoundingClientRect().left - (pinezka2.width/2) + (obrazek.width/2) + "px";

